import { Button, InputAdornment, TextField } from "@mui/material"
import axios from "axios"
import React from "react"
import style from './CadastroVeicular.module.scss';


export const CadastroVeicular = ({placa}) => {
    const [info, setInfo] = React.useState({
        veiculo: '',
        modelo: '',
        chassi: '',
        motor: '',
        fabricante: '',
        especieVeiculo: '',
        corVeiculo: '',
        combustive: '',
        cilindrada: '',
        anoFabricacao: '',
        anoModelo: '',
        municipio: '',
        uf: '',
        tipoVeiculo: '',
        potencia: '',
        passageiroMax: '',

    })

    React.useEffect(() => {
        axios.get('http://localhost:3001/Servicos', {
            params: { placa }
        })
        .then(res => {
            if(res) {
                let teste = res.data.RESPOSTA.BASE_AGREGADOS;
                console.log(teste)
                setInfo(a => ({...a, 
                    veiculo: teste.Grupo_Modelo,
                    modelo: teste.MarcaModelo,
                    chassi: teste.chassi,
                    motor: teste.Motor,
                    fabricante: teste.Fabricante,
                    especieVeiculo: teste.EspecieVeiculo,
                    corVeiculo: teste.CorVeiculo,
                    combustivel: teste.Combustivel,
                    cilindrada: teste.Cilindradas,
                    anoFabricacao: teste.AnoFabricacao,
                    anoModelo: teste.AnoModelo,
                    municipio: teste.Municipio,
                    uf: teste.UF,
                    tipoVeiculo: teste.TipoVeiculo,
                    potencia: teste.Potencia,
                    passageiroMax: teste.QtdPax,
                }))

            } else {
                console.log('Erro:', res)
            }
        })
        .catch(err => console.log(err))
    },[placa])
    
    const SalvarVeiculo = () => {
        axios.post('http://localhost:3001/Servicos', {info})
        .then(res => {
            console.log(res)
        })
        .catch(err => {
            console.log(err)
        })
    }

    const padrao = {
        minWidth: '30vw',
        margin: 1.5,
    }

    return(
        <>
        {info !== '' ? 
        <>
        <form className={style.formulario} onSubmit={SalvarVeiculo}>
            <TextField sx={padrao} size='small' label='Veículo' value={info.veiculo} onChange={(e) => setInfo(a => ({...a, veiculo: e.target.value}))}/>
            <TextField sx={padrao} size='small' label='Modelo' value={info.modelo} onChange={(e) => setInfo(a => ({...a, modelo: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Chassi' value={info.chassi} onChange={(e) => setInfo(a => ({...a, chassi: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Motor' value={info.motor} onChange={(e) => setInfo(a => ({...a, motor: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Fabricante' value={info.fabricante} onChange={(e) => setInfo(a => ({...a, fabricante: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Espécie do Veículo' value={info.especieVeiculo} onChange={(e) => setInfo(a => ({...a, especieVeiculo: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Cor do Veículo' value={info.corVeiculo} onChange={(e) => setInfo(a => ({...a, corVeiculo: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Combustível' value={info.combustivel} onChange={(e) => setInfo(a => ({...a, combustivel: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Cilindrada' value={info.cilindrada} onChange={(e) => setInfo(a => ({...a, cilindrada: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Ano de Fabricação' value={info.anoFabricacao} onChange={(e) => setInfo(a => ({...a, anoFabricacao: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Ano do Modelo' value={info.anoModelo} onChange={(e) => setInfo(a => ({...a, anoModelo: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Município' value={info.municipio} onChange={(e) => setInfo(a => ({...a, municipio: e.target.value}))} />
            <TextField sx={padrao} size='small' label='UF' value={info.uf} onChange={(e) => setInfo(a => ({...a, uf: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Tipo do Veículo' value={info.tipoVeiculo} onChange={(e) => setInfo(a => ({...a, tipoVeiculo: e.target.value}))} />
            <TextField sx={padrao} size='small' label='Potencia' value={info.potencia} onChange={(e) => setInfo(a => ({...a, potencia: e.target.value}))} InputProps={{endAdornment: <InputAdornment position='end'>CV</InputAdornment>}} />
            <TextField sx={padrao} size='small' label='Lotação Máxima' value={info.passageiroMax} onChange={(e) => setInfo(a => ({...a, passageiroMax: e.target.value}))} InputProps={{endAdornment: <InputAdornment position='end'>Passageiros</InputAdornment>}} />
            <Button sx={{m: '0 40%'}} type='submit'>Salvar</Button>
        </form>
        </>
        : <p>Loading</p>}
        </>
    )
}
